  false,\n\t\"url\": null,\n\t\"notes\": \"This map service displays data derived
  from the 2008-2012 American Community Survey (ACS). Values derived from the ACS
  and used for this map service include: Total Population, Population Density (per
  square mile), Percent Minority, Percent Below Poverty Level, Percent Age (less than
  5, less than 18, and greater than 64), Percent Housing Units Built Before 1950,
  Percent (population) 25 years and over (with less than a High School Degree and
  with a High School Degree), Percent Linguistically Isolated Households, Population
  of American Indians and Alaskan Natives, Population of American Indians and Alaskan
  Natives Below Poverty Level, and Percent Low Income Population (Less Than 2X Poverty
  Level). The map service was created for inclusion in US EPA mapping applications.\",\n\t\"license_title\":
